      html, body {

      }

        justify-content: center;

      }

        flex-wrap: wrap;
        width: 1060px;
        background: #fafafa;
        padding: 20px;
        text-align: center;
        justify-content: center;
      }

      .row {
        display: flex;
        flex-direction: column;
        padding: 20px 40px;
        text-align: center;
      }

      .row:nth-child(2n + 1) {
        background: #fafafa;
      }

      .row:nth-child(2n) {
        background: #fff;
      }

      .hanakana {
        font-size: 90px;
        font-family: Hanakana;
        position: relative;
        top: -6px;
      }

      .ascii {
        font-size: 32px;
        font-family: Noto;
        opacity: 0.4;
        display: block;
        padding-bottom: 10px;
      }

      .encoding {
        font-size: 20px;
        font-family: Noto;
        opacity: 0.4;
        display: block;
      }
